import{r,o as i,c as d,a as t,b as s,w as n,F as A,d as a,e}from"./app.d7f90413.js";import{_ as p}from"./getting_started_6.7c3c9f40.js";import{_ as l}from"./plugin-vue_export-helper.21dcd24c.js";var c="/assets/upload_training_data.5e05a533.png",h="/assets/stepper.56bc3a1d.png",g="/assets/upload_test_data.d43e063d.png",m="/assets/stepper_test.a2af1b1d.png",u="/assets/interactive_plots.f5461725.png",f="data:image/png;base64,",b="data:image/png;base64,",v="/assets/yoffset.a1b9b08f.png",w="data:image/png;base64,",R="data:image/png;base64,",k="data:image/png;base64,";const y={},S=a('<h1 id="tutorial" tabindex="-1"><a class="header-anchor" href="#tutorial" aria-hidden="true">#</a> Tutorial</h1><h2 id="choosing-your-level-of-expertise" tabindex="-1"><a class="header-anchor" href="#choosing-your-level-of-expertise" aria-hidden="true">#</a> Choosing your level of expertise</h2><p>Depending on the tasks that you are working on and on your level of experience with preprocessing and analyzing Raman spectroscopic data, you should select one of the following expertise levels:</p><p><img src="'+p+'" alt="Expertise level menu"></p>',4),Q=t("strong",null,"Level 1",-1),D=e(" is the most suitable for the test and identification tasks. This expertise level allows to import the *"),Z=t("em",null,".rspa",-1),I=e(" model file, import the data (see "),x=e("Data Input"),E=e(") and perform the prediction in a single click without adjusting any parameters. For more details see "),U=t("a",{href:"#predicting-test-data"},"Predicting test data",-1),B=e("."),j=a('<p><strong>Level 3</strong>, additionally to the functionality of the first level, makes possible to preprocess training data and build a model on the training data with preset parameters. Either default parameters or parameters saved as a <em>\u201C.txt\u201D</em> file may be applied to the data. Only few options, such as presence of 2 spectra for each point (typical for BPE data) and a validation type (batch-out or 10-fold cross-validation) can be changed at this level of expertise.</p><p><strong>Level 5</strong> <strong>(default)</strong>. Besides the options available on previous levels, this level provides controls for tuning spectral ranges at different steps of the preprocessing routine and a number of components used after the dimension reduction. Starting from this level of expertise, a step-by step execution of the data processing workflow is possible.</p><p><strong>Level 7</strong> makes possible to choose algorithms for baseline correction, normalization, and model construction. Advanced functionality becomes available to a user at this level, including a possibility to control data quality by setting various thresholds and averaging spectra according to a specified grouping.</p><p><strong>Level 9</strong> makes all the parameters, accessible. For example, advanced parameters for the calibration step, or a peak range for integrated intensity thresholding. At the model construction step, number of epochs for CNN dimension reduction, SVM cost and kernel become available.</p><h2 id="analyzing-training-data" tabindex="-1"><a class="header-anchor" href="#analyzing-training-data" aria-hidden="true">#</a> Analyzing training data</h2><p>The data analysis functionality is available for <em>expertise levels above 1</em> (see <a href="#choosing-your-level-of-expertise">Choosing your level of expertise</a>). If a lower experience level is set, only the testing is possible (see <a href="#predicting-test-data">Predicting test data</a>).</p><p><img src="'+c+'" alt="Stepper"></p>',7),O=e("To import the training data, find a panel named "),L=t("em",null,"\u201CTraining data\u201D",-1),Y=e(", click "),T=t("em",null,"Import --> Training data",-1),H=e(" and select a pre-structured ZIP file (see "),J=e("Data Input"),C=e(")."),M=a('<p>To analyze data in a single click, use the <strong>Analyze</strong> button (left panel). After clicking the button the analysis process will begin step by step and the results for each data processing step can be accessed by clicking on the icons at the stepper panel at the top of the program window:</p><p><img src="'+h+'" alt="Stepper"></p><p>The summary of the analysis can also be accessed in a form of a complete report by clicking at the <strong>Report</strong> icon at the stepper panel. Other results can be exported through the <em>\u201CExport\u201D</em> menu at the left panel.</p><p>Specific pre-set parameters can be imported as a text file through <em>&quot;Import -&gt; Parameters&quot;</em>. Furthermore, parameters can be manually adjusted for each data processing step. A set of the adjustable parameters depends on the selected expertise level (see <a href="#choosing-your-level-of-expertise">Choosing your level of expertise</a>).</p><h2 id="predicting-test-data" tabindex="-1"><a class="header-anchor" href="#predicting-test-data" aria-hidden="true">#</a> Predicting test data</h2>',5),V=e("To import the test data, find a panel named \u201CTest data\u201D, click Import \uF0AE Test data and select a pre-structured ZIP file (see "),q=e("Data Input"),P=e(")."),N=a('<p><img src="'+g+'" alt="Stepper"></p><p>The test data predictions can be generated using either a model constructed from training data or using a pre-stored model. How to construct the model is described in <a href="#analyzing-training-data">Analyzing training data</a>. To import a pre-built model, find a panel named \u201CTest data\u201D, click Import \uF0AE Model and select *.rspa file. The pretreatment and the preprocessing of the test data are performed with the same parameters that were used for the training data. When a pre-stored model is used, these parameters are embedded in the model and cannot be changed by the user.</p><p>After importing or generating the model and importing the test data, simply click <em>\u201CPredict\u201D</em> at the <em>\u201CTest data\u201D</em> panel. To see more details, please click at the icons <strong>Test data</strong> and <strong>Prediction</strong> at the upper stepper panel.</p><p><img src="'+m+'" alt="Stepper"></p><p>The summary for preprocessed data can be found in a form of a report. Other results can be exported through the <em>\u201CExport\u201D</em> menu at <em>\u201CTest data\u201D</em> panel.</p><h2 id="interactive-plots" tabindex="-1"><a class="header-anchor" href="#interactive-plots" aria-hidden="true">#</a> Interactive plots</h2><p>To change the styles of the graphs before saving and highlight the information of interest, the following tools can be used:</p><ol><li><p><strong>Zoom</strong>: click on the canvas and hold to expand the area that should be zoomed in. Work in both vertical and horizontal directions. Double click \u2013 reset to initial scale.</p></li><li><p><strong>Lock one spectrum</strong>: click on one spectrum to highlight it (R.terrigena DSM 2687) and click on the empty space on the canvas to unlock it.</p><p><img src="'+u+'" alt="Interactive plots"></p></li><li><p><strong>Remove/Add spectra</strong>: hover on the legend area and use the checkboxes to hide/add spectra</p></li><li><p><strong>Legend</strong>: hover on the spectrum label to highlight it on the canvas. Come back to the canvas to examine the value in a hovered point.</p></li><li><p>Top toolbar functionality:</p></li></ol><table><thead><tr><th>Icon</th><th>Action</th></tr></thead><tbody><tr><td><img src="'+f+'" alt="Save plot as a PNG file"></td><td>Save high quality image in a PNG format.</td></tr><tr><td><img src="'+b+'" alt="Save plot as a CSV file"></td><td>Save data in a CSV format to plot it by yourself in a different program</td></tr><tr><td><img src="'+v+'" alt="Add offset on Y-axis"></td><td>Add offset on Y-axis to better distinguish nearby spectra</td></tr><tr><td><img src="'+w+'" alt="Colored area visibility"></td><td>Make invisible a colored area on the canvas which shows selected wavenumbers range</td></tr><tr><td><img src="'+R+'" alt="SD visibility"></td><td>Add/remove standard deviation</td></tr><tr><td><img src="'+k+'" alt="Background grid"></td><td>Add/remove grid on the background</td></tr></tbody></table>',9);function X(F,z){const o=r("RouterLink");return i(),d(A,null,[S,t("p",null,[Q,D,Z,I,s(o,{to:"/documentation/Data.html"},{default:n(()=>[x]),_:1}),E,U,B]),j,t("p",null,[O,L,Y,T,H,s(o,{to:"/documentation/Data.html"},{default:n(()=>[J]),_:1}),C]),M,t("p",null,[V,s(o,{to:"/documentation/Data.html"},{default:n(()=>[q]),_:1}),P]),N],64)}var _=l(y,[["render",X]]);export{_ as default};
